import Carousel from 'react-elastic-carousel'
import image1 from '.././testimonials/1.png';
import image2 from '.././testimonials/2.png';
import image3 from '.././testimonials/3.png';

const Work =({WorkCompleted})=> {

  const[items,setItems]=useState({WorkCompleted});

  const [visible,setVisible]=useState(3);


   return (
    <div className="home2">
        <div className="mt4">
          <h2 data-aos="fade-up" data-aos-duration="1500"> Projects Completed</h2>
          <div className="bb bw2 left mt4"></div>
            <div className="ma4">
            {
              items.slice(0,2).map(item=>
                {
                  <div>
                    <div>{item.title}</div>
                    <p>{item.description}</p>
                  </div>
                })}
            </div>
         </div>
        </div>
          )
      };
export default Work;
